description:
The Need for Speed

Technology Documentary hosted by William Hootkins, published by Discovery Channel broadcasted as part of DC Extreme Machines series in 2000 - English narration


Information
------------------------------

From the British speed heroes of the 1930s to the first man to break the sound barrier; man is constantly obsessed with pushing the boundaries of speed, often at the ultimate cost - their own lives. This is a celebration of our adrenaline-fuelled passion to go faster than ever before. So sit back, buckle up and prepare to be overwhelmed by the need for speed.




2)  Supersonic Landspeed 
In 1997, Andy Green broke through the sound barrier in the jet powered Thrust SSC. This incredible achievement was celebrated around the world and Britain honoured Andy Green as a hero, the first man to break the sound barrier on land. Andy Green earned a place in the record books, but was he really the first? &quot;Supersonic Landspeed&quot; charts the history of those who risked their lives to break the landspeed record and examines how technology has evolved to make it happen.

Narrator: William Hootkins
Director: Alice Harper
Producer: Kirstie McLure
Executive Producer: Stuart Carter
Producer for The Learning Channel: Marly Carpenter
Executive Producer for The Learning Channel: Jeanne Shanahan
